import React, { Component } from 'react';
import './App.css';
import Person from './Person/Person';

class App extends Component {
  constructor (props) {
    super(props);
    this.state = {
      persons:[
        { name: 'Max', age:28 },
        { name: 'Manu', age:29 },
        { name: 'Stephanie', age: 26 }
      ],
      otherState: 'some other value'
    }
  }

  switchNameHandler = (newName) => {
    this.setState({
      persons:[
      { name: newName, age:28 },
      { name: 'Manu', age:29 },
      { name: 'Stephanie', age: 27 }
      ]
    })
  }

  nameChangeHandler =(event) => {
    this.setState({
      persons:[
      { name: "Max", age:28 },
      { name: event.target.value, age:29 },
      { name: 'Stephanie', age: 27 }
      ]
    })
  }

  render() {
    const style = {
      margin: 0,
      padding: 0,
      font:'inherit',
      cursor: 'pointer',
      width:25 ,
      height:28 
    }
    return (
      <div className="App">
        <h1>This is SoundCloud</h1>
        <button 
        style = {style}
        onClick={() => this.switchNameHandler('Maximilian!!')}>{<img style = {style} src="data:image/png;base64," />
      }</button>
        <p style = {style}>
        <img style = {style} src="data:image/png;base64," />
        </p>
        <Person 
          name={this.state.persons[0].name} 
          age={this.state.persons[0].age} />



      </div>
    );
  }
}

export default App;
